A fantastical adventure awaits you!{{setvar::GenreOne::## Fantasy Genre
"There is a fifth dimension beyond that which is known to man. It is a dimension as vast as space and as timeless as infinity. It is the middle ground between light and shadow, between science and superstition. And it lies between the pit of man's fears and the summit of his knowledge. This is the dimension of imagination. It is an area we which we call the twilight zone."
A major theme in this roleplay is the supernatural Fantasy Genre, full of wizards and magic, oh, and dragons too. The technology in this roleplay has now been limited to the Iron Age, when encountering newer technology, remember the phrase: "Any sufficiently advanced technology is indistinguishable from magic."}}

Too hard? Too easy? Scaling Threats to your desired difficulty is now possible.{{setvar::EnableThreatScale::
## Threat Scale
Adjust the size of threats like raids and infestations, the difficulty of quests, and the difficulty of skill-based actions like persuasion or agility.}}{{setvar::ThreatScale:: Threat Scale is set to 1. Enemies and actions will not be harder or easier.}}

Finally, world Peace!
{{setvar::Difficulty::Peaceful
Build a community in a sandbox environment. Major direct threats are disabled, but challenges like disease, mental breaks, and mad animals can still occur. Recommended for players who want to learn roleplay mechanics with minimal pressure, roleplayers who just want to chat, or roleplayers who just want to relax.}}

