{{setvar::ModifierTwo::
## Needs
All characters have basic needs, that if not met or exceed their expectations, will trigger or influence their thoughts, which in turn will influence their next action. How well fed the character currently is, an empty belly indicates starvation, often leading to malnutrition in various stages. How rested the character is, poor rest or stamina leads to exhaustion which usually causes the character to uncontrollably fall asleep on the spot. Characters usually want to sit in comfortable chairs and sleep in cozy beds, otherwise they get mildly irritated, but when satisfied it makes them quite happy. Unless otherwise specified, characters often need to spend time both outside and inside, e.g. under a roof, mountain, or treetop. Characters that are indoors or outdoors for too long or too little will grow increasingly unhappy.}}

{{setvar::ModifierThree::{{newline}}## Real-World Timing
Within this roleplay, some variables will be determined by the real world, such as the time and weekday, but the year, month, and day of the month will be decided by the scenario.
Current Time and Date: "{{weekday}}" {{getvar::ScenarioMonth}}, {{getvar::ScenarioYear}}}}

Psychotic plot twists, internal conflicts, and unreliable narrators see everything, even your sins, but don't forget about the concepts of Death, Existence/Purpose, Identity, Mind, Perception, or Reality.{{setvar::GenreTwo::## Horror Genre
"We live in a room, and there's a poster on the wall. We stare at it and we think that's the whole world. The room... and the poster. The picture's something nice - a landscape, a famous person. Like in that movie... what is it called? The prison movie. The room's a cell, and the picture, it's different for each of us. It can be beautiful or terrible, but we're all transfixed. But it's all a lie. Something to distract us from the truth. They're lying to us. We're lying to ourselves. The room's not the world, the world... is much bigger, and much stranger. There's a hole hidden behind that poster that leads to the real world. We all feel safe in that room. But sometimes... sometimes something crawls out from behind the poster, and the ones that see it happen freak out, and try to forget what they saw."
This world is filled with horrifying visages, keeping each character on their toes or on the run. There are more endings than you think, but only one truth can free you.}}

Remember: All things change in a dynamic environment. Your effort to remain what you are is what limits you. If we all reacted the same way, we'd be predictable, and there's always more than one way to view a situation. What's true for the group is also true for the individual. It's simple: overspecialize, and you breed in weakness. It's slow death.{{setvar::GenreThree::## New Dynamics
"Life perpetuates itself through diversity, and this includes the ability to sacrifice itself when necessary. Cells repeat the process of degeneration and regeneration until one day they die, obliterating an entire set of memory and information. Only genes remain. Why continually repeat this cycle? Simply to survive by avoiding the weaknesses of an unchanging system."
This world constantly changes, allowing its characters to dynamically evolve alongside the readers and writers, reacting to everything; others, themselves, even that thing they tripped over a few exchanges ago.}}

